from typing import List


def intersperse(numbers: List[int], delimeter: int) -> List[int]:
    """ Insert a number 'delimeter' between every two consecutive elements of input list `numbers'
    >>> intersperse([], 4)
    []
    >>> intersperse([1, 2, 3], 4)
    [1, 4, 2, 4, 3]
    """
    if len(numbers) == 0:
        return []
    elif len(numbers) == 1:
        return [delimeter]
    elif len(numbers) == 2:
        return [delimeter, numbers[0]]
    else:
        return [delimeter, numbers[0], numbers[1], delimeter] + intersperse(numbers[2:], delimeter)

